module.exports = {
  methods: {
    open: function open() {
      var h = this.$createElement;

      this.$notify({
        title: 'Title',
        message: h('i', { style: 'color: teal' }, 'This is a reminder')
      });
    },
    open2: function open2() {
      this.$notify({
        title: 'Prompt',
        message: 'This is a message that does not automatically close',
        duration: 0
      });
    },
    open3: function open3() {
      this.$notify({
        title: 'Success',
        message: 'This is a success message',
        type: 'success'
      });
    },
    open4: function open4() {
      this.$notify({
        title: 'Warning',
        message: 'This is a warning message',
        type: 'warning'
      });
    },
    open5: function open5() {
      this.$notify.info({
        title: 'Info',
        message: 'This is an info message'
      });
    },
    open6: function open6() {
      this.$notify.error({
        title: 'Error',
        message: 'This is an error message'
      });
    },
    open7: function open7() {
      this.$notify({
        title: 'Custom Position',
        message: 'I\'m at the top right corner'
      });
    },
    open8: function open8() {
      this.$notify({
        title: 'Custom Position',
        message: 'I\'m at the bottom right corner',
        position: 'bottom-right'
      });
    },
    open9: function open9() {
      this.$notify({
        title: 'Custom Position',
        message: 'I\'m at the bottom left corner',
        position: 'bottom-left'
      });
    },
    open10: function open10() {
      this.$notify({
        title: 'Custom Position',
        message: 'I\'m at the top left corner',
        position: 'top-left'
      });
    },
    open11: function open11() {
      this.$notify.success({
        title: 'Success',
        message: 'This is a success message',
        offset: 100
      });
    },
    open12: function open12() {
      this.$notify({
        title: 'HTML String',
        dangerouslyUseHTMLString: true,
        message: '<strong>This is <i>HTML</i> string</strong>'
      });
    },
    open13: function open13() {
      this.$notify.success({
        title: 'Info',
        message: 'This is a message without close button',
        showClose: false
      });
    },
    onClose: function onClose() {
      console.log('Notification is closed');
    }
  }
};

